    {
        try
        {
            _bill.TotalAmount = _bill.OriginalAmount + (_bill.OriginalAmount * _bill.Percentage / 100);
        }
        catch { }
    }

    private void OnAmountPaid_Changed()
    {
        try
        {
            _bill.RestAmount = _bill.TotalAmount - _bill.AmountPaid;
        }
        catch { }
    }


